import { CloudArrowUp, CodeSimple, ToggleLeft, PaintBucket, DeviceMobile, GitFork } from 'phosphor-react-native';

export const QUIZZES = [
  {
    id: 1,
    title: 'Penalaran Umum',
    level: 1,
    paket: 1,
    svg: ToggleLeft,
  },
  {
    id: 2,
    title: 'Penalaran Umum',
    level: 1,
    paket: 2,
    svg: ToggleLeft,
  },
  {
    id: 3,
    title: 'Penalaran Umum',
    level: 1,
    paket: 3,
    svg: ToggleLeft,
  },
  {
    id: 4,
    title: 'Penalaran Umum',
    level: 2,
    paket: 1,
    svg: ToggleLeft,
  },

  {
    id: 5,
    title: 'Pengetahuan dan Pemahaman Umum',
    level: 2,
    paket: 1,
    svg: CodeSimple,
  },
  {
    id: 6,
    title: 'Pemahaman Bacaan dan Menulis',
    level: 2,
    paket: 1,
    svg: GitFork,
  },
  {
    id: 7,
    title: 'Pengetahuan Kuantitatif',
    level: 3,
    paket: 1,
    svg: PaintBucket,
  },
  {
    id: 8,
    title: 'Literasi',
    level: 2,
    paket: 1,
    svg: CloudArrowUp,
  },
  {
    id: 9,
    title: 'Penalaran Matematika',
    level: 1,
    paket: 1,
    svg: DeviceMobile,
  },
];
